__ht__function transformFilter(rawData) {
    try {
        var t = rawData.dev_info,
            dev = t.split("——");
        var name = rawData.name,
            id = rawData.data_id,
            pk = rawData.data_pk,
            devName = dev[0],
            devId = dev[1],
            rw = rawData.rw,
            tm = rawData.tm,
            ts = rawData.ts,
            _type = rawData.val_type,
            _value = rawData.val;
        return _value;
    } catch (err) {
        return rawData;
    }
}

